function increaseAllowance(address spender, uint256 addedValue) public returns (bool) {
    require(spender != address(0), "ERC20: approve to the zero address");

    address owner = msg.sender;
    bytes32 allowanceKey = keccak256(abi.encodePacked(owner, spender));

    require(
        allowances[allowanceKey] <= type(uint256).max - addedValue,
        "SafeMath: addition overflow"
    );

    allowances[allowanceKey] += addedValue;

    emit Approval(owner, spender, allowances[allowanceKey]);

    return true;
}

